import React, {Component} from 'react';

class Test extends Component {    
        state = {   
            items: [
            {
                id:1,
                bezitting: 'horloge',
                waarde: 300
            },
            {
                id:1,
                bezitting: 'auto',
                waarde: 18000
            },
            {
                id:1,
                bezitting: 'huis',
                waarde: 400000
            }
            ]

             
        };  
      
    
    render() {    
        return (      
            <div>        
              <p>{this.state.id}</p>        
              <p>{this.state.name}</p>      
            </div>    
        );  
    }
}

export default Test
